import React from 'react'
import '../Sidebar.css'
import Side from './Side'
import HomeIcon from '@material-ui/icons/Home';




function Sidebar() {
return (
        <div className='SideBarRow'>
        <Side Icon ={HomeIcon}  title="home"/>
        <Side title="Trending"/>
        <Side title="Subscription"/>
        <Side title="Library"/>





        </div>
)
}

export default Sidebar
